import React, { Component } from "react";
import { Link } from 'react-router-dom';


class Product extends Component {
	render() {
		return (
			<div class="col-12 col-md-3 col-sm-6">
				<figure class="card card-product p-2 pb-3">
					<div class="container-float">
						<span class="badge badge-danger float-right"> NEW </span>
					</div>
					<figcaption class="info-wrap pt-3">
						<a href="#" class="text-decoration-none">
							<div class="img-wrap">
								<img src={require("../images/logo/logo.png")} />
							</div>
							<p class="title mt-2" style={{ fontWeight: 600 }}>
								namaProduk</p></a>
						<p class="border-top border-bottom">harga</p>
						<a>nama penjual</a>
						<div class="action-wrap">
							<a href="#" class="btn btn-info"><i class="fas fa-cart-plus"></i> Add to Cart </a>
						</div>
					</figcaption>
				</figure>
			</div>
		);
	}
}

export default Product;
